import React, { Component } from 'react';

class PeticionAlmacen extends Component {

    render() {
        return (
            <div>
                <h2 class="ui header">

                    <div class="content">
                        Peticiones Almacen
                           <div class="sub header">Selecciona el tipo de solicitud que necesitas </div>
                    </div>
                </h2>

            </div>
        )
    }

}


export default PeticionAlmacen
